import axios from "axios";
import api from "../../api/api";
const REST_API_BASE_URL = 'http://localhost:8080/';

export const listManagers = () => {
    return api.get(`admin/getAllManagers`,{ withCredentials: true } );
}

export const listEmployees = () => {
    return axios.get(`admin/getEmployees`,{ withCredentials: true } );
}

export const listEmployeesLeaveRequests = () => {
    return axios.get(`api/admin/getEmployeeLeaveRequestsReport`,{ withCredentials: true } );
}

export const listEmployeesExitRequests = () => {
    return axios.get(`api/admin/getEmployeeExitRequestsReport`,{ withCredentials: true } );
}

export const getuserDetails = (email) => {
    return axios.get(`/admin/getuserDetails?email=${email}`,{ withCredentials: true } );
}
